    function genererNumeroUnique(PDO $db): string
    {
        do {
            $numero = str_pad(mt_rand(0, 9999999999), 10, '0', STR_PAD_LEFT);
            $stmt = $db->prepare("SELECT COUNT(*) FROM devis WHERE numero = ? AND statut = 'devis'");
            $stmt->execute([$numero]);
            $existe = $stmt->fetchColumn() > 0;
        } while ($existe);

        return $numero;
